import React, { Component } from 'react';

class Uploader extends React.Component {
    render() {
        return (
            <section className='upload'>
                <h1 className='upload__title'>Upload Video</h1>
                <form>
                    <label for="titleinp">TITLE YOUR VIDEO</label>
                    <input className='upload__titleinput' id='titleinp' placeholder='Add a title to your video' type='text'></input>
                    <label for="descinp">ADD A VIDEO DESCRIPTION</label>
                    <input className='upload__descriptioninput' id='descinp' placeholder='Add a description of your video' type='text'></input>
                    <input className='upload__publish' type='submit'></input>
                    <button className='upload__cancel'>Cancel</button>
                </form>
            </section>
        )
    }
}

export default Uploader;
